import React, { Component } from "react";
import Axios from "axios";
import "./law_report.css";
import { ReactTable } from "react-table";
import "react-table/react-table.css";

class law_report extends Component {
  constructor(props) {
    super(props);
    this.state = {
      lawyers: [],
    };
  }
  componentDidMount = () => {
    const url = "/lawyersReporter";
    Axios.get(url).then((response) => {
      //console.log(response.data.tem_c);
      //this.setState({ tableData: response.data.tableData });
      console.log(response.data.rows);
    });
  };

  render() {
    const columns = [
      {
        Header: "Employee ID",
        accessor: "employee_ID",
      },
      {
        Header: "First Name",
        accessor: "firstName",
      },
      {
        Header: "Last Name",
        accessor: "lastName",
      },
      {
        Header: "Grading",
        accessor: "barGrading",
      },
    ];
    return <ReactTable columns={columns}></ReactTable>;
  }
}

export default law_report;
